<h4>Простое умножение</h4>
<br/>
<p>В данной задаче необходимо произвести умножение двух целых чисел друг на друга.</p>
<br>
<p>На вход подается два числа A и B, где:</p>
<p><b>-int</b> < <b>A</b> < <b>B</b> < <b>+int</b></p>
<p>На выходе результат умножения A на B</p>
<br>
<h5>Пример</h5>
<p>Входные данные:</p>
<code>10 5</code>
<p>Выходные данные:</p>
<code>50</code>
